import React from 'react';

const Footers = () => (
    <footer className='footer'>
        <div className='footer__container'>
            <span className='footer__item'>© 2020 Все права защищены</span>
            <a href='https://github.com/VanyaKirdun' className='footer__item'>Сделано Кирдуном Иваном</a>
        </div>
    </footer>
)

export default Footers;
